import React from 'react';

const aTags = ['Home', 'Bio', 'Gallery']

const listItems = aTags.map((item) => {
    <li>
        <a href={item}>{item}</a>
    </li>
})

export class Header extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            aTags: ['Home', 'Bio', 'Gallery'],
            date: new Date()
        }
    }

    render() {
        return <div>
            <ul>
              {listItems} 
            </ul>
            <h1>Hello World</h1>
        </div>
    }
}
